                <h2 class="display-5 mb-3 fw-semibold lh-sm">Components, meet the Utility&nbsp;API</h2>
                <p class="lead fw-normal">
                    New in Bootstrap 5, our utilities are now generated by our <a href="/docs/5.2/utilities/api/">Utility API</a>. We built it as a feature-packed Sass map that can be quickly and easily customized. It's never been easier to add, remove, or modify any utility classes. Make utilities responsive, add pseudo-class variants, and give them custom names.
                </p>
                <p class="d-flex align-items-start flex-column lead fw-normal mb-0">
