                <h2 class="display-5 mb-3 fw-semibold lh-sm">Powerful JavaScript plugins without&nbsp;jQuery</h2>
                <p class="lead fw-normal">
                    Easily add toggleable hidden elements, modals and offcanvas menus, popovers and tooltips, and so much moreâall without jQuery. JavaScript in Bootstrap is HTML-first, which means adding plugins is as easy as adding <code>data</code> attributes. Need more control? Include individual plugins programmatically.
                </p>
                <p class="d-flex justify-content-start lead fw-normal mb-md-0">
                    <a href="/docs/5.2/getting-started/javascript/" class="icon-link fw-semibold">
                        Learn more about Bootstrap JavaScript
                        <svg class="bi"><use xlink:href="#arrow-right-short"></use></svg>
                    </a>
                </p>
            </div>
